import React from 'react';

class CourseworkPanel extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div className="coursework-wrapper">
        { this.props.coursework.map((value, index) => (<p key={index} className="coursework">{value}</p>)) }
      </div>
    )
  }
}
